	(10, 912398, 'Feira Livre', 98, '1', '1', '0', 1, 0, 10, '', 'pets3', 'catalog_marketplace_header_en|catalog_note_marketplace', 'A Feira Livre é um jeito fácil e seguro de você venderou comprar seus mobis raros!Como a Feira Livre funciona?|Para adquirir raros: \r\n|Como você tem absolutamente todos os mobis disponível no catálogo, seja ele antigo ou atual, a Feira Livre é utilizada para a compra e venda de raros. Procure pelo raro que você quer comprar na página de Ofertas da Feira Livre e clique em Adquirir o item pelo preço anunciado na mesma hora da compra. Lembrando que a CrazzY VIP tem 20% de desconto no ato da compra! |Para vender na Feira Livre: \r\nVocê pode vender qualquer RARO do seu inventário. Ele estará marcado como permitido. Basta selecionar o item no iventário marcado e clicar no botão "Vender na Feira Livre". NOTA: Você pode vender até 250 itens ao mesmo tempo.', '0'),
