	(912447, 9021, 'Verão 2017', 274, '1', '1', '0', 1, 0, 950, '', 'default_3x3', '', '', '0'),
	(912448, 503, 'Como Jogar Banzai', 42, '0', '1', '0', 1, 0, 2, 'banzaitut', 'pets3', 'banzai|banzai1', 'Battle Banzai - Crie agora seu quarto de batalha e divirta-se com seus amigos. Battle Banzai funcionando 100%:|Como fazer o seu Battle Banzai:\r\n|1. Vá ao quarto seu quarto;\r\n\r\n2. Coloque os Pisos Banzai no chão e as Divisórias ao redor para limitar a área da batalha;\r\n\r\n3. Coloque um Portão de Time em cada lado para cada time. Há quatro deles: azul, vermelho, verde e amarelo;\r\n\r\n4. Coloque o Cronômetro e os Placares na área de jogo;\r\n\r\n5. Quando estiver tudo pronto, chame seus amigos e posicione-se;\r\n\r\n6. Clique no Cronômetro para começar e tenha um bom jogo!', '0'),
	(912449, 503, 'Como Jogar Freeze', 42, '0', '1', '0', 1, 0, 4, 'freezetut', 'pets3', 'Catalog_header_freeze|freeze1', 'Aqui você descobre tudo sobre o Freeze! |Como jogar Freeze: \r\n\r\n|1. Vá para o quarto em que você dedicou para o Freeze e coloque os pisos e gelos de bloco Freeze no chão. Lembre-se de utilizar muros para definir sua arena e colocar blocos de gelo em cima dos pisos!\r\n2. Adicione para cada time um portão. Você pode ter até quatro times: azul, vermelho, amarelo e verde.\r\n3. Coloque o Relógio e os placares na Arena.\r\n4. Por último, coloque uma saída na Arena em algum lugar do seu Quarto. Este será o lugar onde os jogadores irão quando acabarem as suas vidas. Agora divirta-se! Lembre-se de sempre colocar um bloco de gelo em cima de um piso, ou o jogo não vai funcionar!', '0'),
	(912450, 912382, 'Como Adquirir Diamantes', 42, '1', '1', '0', 5, 0, 1, 'howtobuydias', 'pets3', 'catalog_frontpage_headline_shop_GENERAL|catalog_note_marketplace', 'O que é a Loja de diamantes?|COMO USAR:|Na loja de diamantes contem mobis personalizados e exclusivos que você pode comprá-los com seus diamantes. Em alguns mobis, você comprará usando suas moedas e seus diamantes em conjunto. \r\n\r\nPara adquirir diamantes você precisará participar de promoções e eventos. \r\nOu em nossa pagina principal poderá compra-lo.\r\nVocê também pode realizar trocas convertendo o diamante em uma moeda negociável!\r\n\r\n', '0'),
