	(1, 0, 1, 1526498098, '0', '0', '1', 3, 'Aliboya', 'ch-215-82.wa-3211-1189-82.hd-205-1.sh-6102459-110-64.lg-3057-1200.hr-155-1037', 'Banco de Sugestões', '<b> Como funciona: <b/>\r\rO <b> Banco de Sugestões <b/> é uma área para ser enviada todas as sugestões de usuários sobre possíveis <b> campanhas, atividades e promoções <b/> você pode enviar a qualquer momento. As sugestões estão sujeitas a avaliação, caso sua sugestão seja efetivada você será notificado.', ''),
	(2, 0, 1, 1526498202, '0', '0', '0', 3, 'Aliboya', 'ch-215-82.wa-3211-1189-82.hd-205-1.sh-6102459-110-64.lg-3057-1200.hr-155-1037', 'Banco de Sugestões', 'O Banco de Sugestões foi criado com o intuito de ouvir melhor cada usuário. Através deste tópico você pode enviar sua própria sugestão, caso sua sugestão seja efetivada, você será notificado.', ''),
	(3, 0, 1, 1526498369, '0', '0', '0', 3, 'Aliboya', 'ch-215-82.wa-3211-1189-82.hd-205-1.sh-6102459-110-64.lg-3057-1200.hr-155-1037', 'Banco de Reclamações', 'O Banco de Reclamações foi criado com o intuito de atender com as reclamações possíveis que poderão estar sujeitas a acontecer. Utilize esta ferramenta com responsabilidade, qualquer descumprimento com a Hiddo Etiqueta, coloca sua conta em revisão para receber sua devida punição.', ''),
	(4, 0, 2, 1540165105, '0', '0', '0', 27486, 'Fred', 'sh-300-96.ch-255-1186.hr-8856282-1343.fa-1206-1308.lg-281-62.hd-190-1390.ha-1002-64', 'AJOELHOU TEM QUE REZAR?', 'SIM, ajoelhou tem que mamar o amigo', ''),
	(5, 4, 2, 1540165138, '0', '0', '0', 27486, 'Fred', 'sh-300-96.ch-255-1186.hr-8856282-1343.fa-1206-1308.lg-281-62.hd-190-1390.ha-1002-64', '', 'muito mesmo rapaziada   ', ''),
	(6, 4, 2, 1540165161, '0', '0', '0', 27488, 'DiogoRoch4', 'hr-115-42.hd-190-1.ch-215-62.lg-285-91.sh-290-62', '', 'claro que tem foda-se!', ''),
