INSERT INTO `site_news` (`id`, `title`, `short`, `story`, `date`, `user`, `image`, `forms`) VALUES
	(1, 'Boas-vindas', 'Faça parte da comunidade mais louca da internet!', '<div style="text-align:center"><img src="https://3.bp.blogspot.com/-dazYBFbySiU/WZyd6JhvDGI/AAAAAAAA8Vs/Up2yNnlDB0oUCKke-9jRJQUJ92V1PM0kQCKgBGAs/s1600/welcome.png" /><br />\r\n&nbsp;</div>\r\n\r\n<div style="text-align:center"><strong><span style="color:orange; font-family:Arial,Helvetica,sans-serif">Boas Vindas&nbsp;</span></strong></div>\r\n\r\n<div style="text-align:center">&nbsp;</div>\r\n\r\n<div><span style="font-family:Arial,Helvetica,sans-serif">Apresentamos a voc&ecirc;s o oHabbo Hotel, um hotel atualizado, repleto de entretenimento, mobis fant&aacute;sticos, novas promo&ccedil;&otilde;es e eventos para alegrar o seu dia a dia e para isso contamos com a ajuda da equipe Staff, uma equipe disposta a estar 24h em torno do hotel, um hotel livre de qualquer tipo de preconceito e discrimina&ccedil;&atilde;o.<br />\r\n<br />\r\nZelamos pela seguran&ccedil;a da nossa comunidade e tamb&eacute;m por um ambiente de paz e harmonia entre todos nossos jogadores. Traremos muitas inova&ccedil;&otilde;es dentre elas est&atilde;o:</span><br />\r\n&nbsp;</div>\r\n\r\n<p><span style="font-family:Arial,Helvetica,sans-serif"><img src="https://4.bp.blogspot.com/-1sja7q5Cu04/Wut4-fDf6SI/AAAAAAAAAlA/TPZS1h4gmP0olhDZ_v7t89vyDGYTDUESACLcBGAs/s1600/Seta.gif" />&nbsp;Jogos e eventos;</span><br />\r\n<span style="font-family:Arial,Helvetica,sans-serif"><img src="https://4.bp.blogspot.com/-1sja7q5Cu04/Wut4-fDf6SI/AAAAAAAAAlA/TPZS1h4gmP0olhDZ_v7t89vyDGYTDUESACLcBGAs/s1600/Seta.gif" />&nbsp;Not&iacute;cias e Promo&ccedil;&otilde;es;</span><br />\r\n<span style="font-family:Arial,Helvetica,sans-serif"><img src="https://4.bp.blogspot.com/-1sja7q5Cu04/Wut4-fDf6SI/AAAAAAAAAlA/TPZS1h4gmP0olhDZ_v7t89vyDGYTDUESACLcBGAs/s1600/Seta.gif" />&nbsp;Hall da fama;</span><br />\r\n<span style="font-family:Arial,Helvetica,sans-serif"><img src="https://4.bp.blogspot.com/-1sja7q5Cu04/Wut4-fDf6SI/AAAAAAAAAlA/TPZS1h4gmP0olhDZ_v7t89vyDGYTDUESACLcBGAs/s1600/Seta.gif" />&nbsp;Planos VIPs;</span><br />\r\n<span style="font-family:Arial,Helvetica,sans-serif"><img src="https://4.bp.blogspot.com/-1sja7q5Cu04/Wut4-fDf6SI/AAAAAAAAAlA/TPZS1h4gmP0olhDZ_v7t89vyDGYTDUESACLcBGAs/s1600/Seta.gif" />&nbsp;Premia&ccedil;&otilde;es;</span><br />\r\n<span style="font-family:Arial,Helvetica,sans-serif"><img src="https://4.bp.blogspot.com/-1sja7q5Cu04/Wut4-fDf6SI/AAAAAAAAAlA/TPZS1h4gmP0olhDZ_v7t89vyDGYTDUESACLcBGAs/s1600/Seta.gif" />&nbsp;Mobis e roupas</span><br />\r\n<br />\r\n<a href="https://1.bp.blogspot.com/-EzsA1zUUZ3o/WZyd6F6B8tI/AAAAAAAA8Vs/e8Ayt9YVBKMM8B1kvWCcPxcNOiUsbHb9ACKgBGAs/s1600/byesw_hotel_64_a_2_2.png" style="clear: right; float: right; margin-bottom: 1em; margin-left: 1em;"><span style="font-family:Arial,Helvetica,sans-serif"><img src="https://1.bp.blogspot.com/-EzsA1zUUZ3o/WZyd6F6B8tI/AAAAAAAA8Vs/e8Ayt9YVBKMM8B1kvWCcPxcNOiUsbHb9ACKgBGAs/s1600/byesw_hotel_64_a_2_2.png" /></span></a><span style="font-family:Arial,Helvetica,sans-serif">Entre outras coisas que voc&ecirc;s iram se surpreender, ent&atilde;o voc&ecirc; n&atilde;o pode perder nada disso, ne? V&aacute; agora mesmo em portais habbo,redes sociais e outros meios de comunica&ccedil;&atilde;o e divulgue o oHabbo Hotel.</span><br />\r\n<br />\r\n<br />\r\n&nbsp;</p>\r\n', 1523240298, 'Roberta', 'https://1.bp.blogspot.com/-99G5q-S_fvg/WZyd6Miy1LI/AAAAAAAA8Vs/jzOkcpg1u78owFrQ6uoir7hY2AhHxAZXgCKgBGAs/s1600/WEB_PROMO_NEWYEAR_BAW.png', ''),
	(2, 'Regras do Hotel', 'Fique por dentro do que pode e o que não pode na nossa comunidade!', '<div class="separator" style="clear:both; text-align:center">&nbsp;<img src="https://1.bp.blogspot.com/-NKgOUBi0DSY/Vt49vSsWt5I/AAAAAAAAj9E/G9oeof6mvyw/s1600/habboway_2.gif" /></div>\r\n\r\n<div style="margin-left:1em; margin-right:1em; text-align:center">&nbsp;</div>\r\n\r\n<div style="margin-left:1em; margin-right:1em; text-align:center"><span style="color:black; font-family:Arial,Helvetica,sans-serif"><span style="background-color:white">Esta &eacute; uma p&aacute;gina voltada para informa&ccedil;&atilde;o onde ajudamos voc&ecirc;s usu&aacute;rios a proteger ainda mais a sua pessoa e a sua conta.</span><br />\r\n<br />\r\n<span style="background-color:white">O oHabbo Hotel cr&ecirc; que a seguran&ccedil;a &eacute; importante para todos, portanto, estamos sempre realizando concursos regulares no hotel, explicando sobre as regras e tentando sempre manter voc&ecirc;s bem informados para n&atilde;o acontecer nenhum problema relacionado &agrave; inseguran&ccedil;a. Por isso, fique atento &agrave;s recomenda&ccedil;&otilde;es abaixo, procurando sempre segui-las para evitar uma puni&ccedil;&atilde;o severa!</span></span></div>\r\n\r\n<div style="margin-left:1em; margin-right:1em; text-align:center">&nbsp;</div>\r\n\r\n<p><span style="color:#add8e6"><span style="font-family:Arial,Helvetica,sans-serif"><strong>1. Proteja suas informa&ccedil;&otilde;es pessoais</strong></span></span></p>\r\n\r\n<p><span style="color:#000000"><span style="background-color:white; font-family:Arial,Helvetica,sans-serif">Voc&ecirc; nunca sabe com quem est&aacute; falando realmente, por isso nunca d&ecirc; o seu endere&ccedil;o, seu n&uacute;mero de telefone ou celular, fotos e em que escola voc&ecirc; estuda. Dando informa&ccedil;&otilde;es pessoais voc&ecirc; pode permitir que m&aacute;s pessoas estejam te roubando, perseguindo ou te deixando em perigo.</span></span><br />\r\n<br />\r\n<span style="color:#add8e6"><span style="font-family:Arial,Helvetica,sans-serif"><strong>2. Mantenha o virtual</strong></span></span><br />\r\n<span style="color:black; font-family:Arial,Helvetica,sans-serif"><span style="background-color:white">Nunca concorde em tudo de uma pessoa que voc&ecirc; conhece apenas atrav&eacute;s da internet, nem sempre as pessoas online s&atilde;o quem dizem.</span></span><br />\r\n<br />\r\n<span style="color:#add8e6"><span style="font-family:Arial,Helvetica,sans-serif"><strong>3. N&atilde;o compartilhe sua imagem pessoal</strong></span></span><br />\r\n<span style="color:black; font-family:Arial,Helvetica,sans-serif"><span style="background-color:white">Jamais aceite pedidos para mostrar sua foto ou seu rosto pela webcam, as imagens que v&atilde;o para internet podem fugir de seu controle, elas podem ser modificadas e at&eacute; mesmo transmitidas ou publicadas em outros sites. Elas tamb&eacute;m podem ser usadas contra voc&ecirc; em forma de amea&ccedil;a ou talvez at&eacute; pior, pense bem antes de mostrar uma foto sua ou seu rosto pelo computador!</span></span><br />\r\n<br />\r\n<span style="color:#add8e6"><span style="font-family:Arial,Helvetica,sans-serif"><strong>4. Denuncie usu&aacute;rios infratores &agrave;s regras</strong></span></span><br />\r\n<span style="color:black; font-family:Arial,Helvetica,sans-serif"><span style="background-color:white">N&atilde;o tenha medo de soar o alarme, se algu&eacute;m te assusta, intimida ou faz coisas estranhas e erradas contra voc&ecirc; ou contra qualquer outra pessoa voc&ecirc; deve nos denunciar, chame um moderador e fa&ccedil;a a den&uacute;ncia.</span></span><br />\r\n<br />\r\n<span style="color:#add8e6"><span style="font-family:Arial,Helvetica,sans-serif"><strong>5. Use uma senha segura</strong></span></span><br />\r\n<span style="color:black; font-family:Arial,Helvetica,sans-serif"><span style="background-color:white">Use uma senha segura, uma combina&ccedil;&atilde;o de pelo menos oito d&iacute;gitos, sendo letras, n&uacute;meros e c&oacute;digos aleat&oacute;rios, e letras mai&uacute;sculas.</span></span><br />\r\n<br />\r\n<span style="color:#add8e6"><span style="font-family:Arial,Helvetica,sans-serif"><strong>6. N&atilde;o divulgue outros hot&eacute;is</strong></span></span><br />\r\n<span style="color:black; font-family:Arial,Helvetica,sans-serif"><span style="background-color:white">H&aacute; diversos outros hot&eacute;is como o oHabbo, mas neles n&atilde;o podemos garantir nem a seguran&ccedil;a nem a qualidade, ent&atilde;o n&atilde;o fa&ccedil;a a divulga&ccedil;&atilde;o de outros, fazemos do oHabbo o melhor hotel poss&iacute;vel, ent&atilde;o fique conosco!</span></span><br />\r\n&nbsp;</p>\r\n\r\n<p><span style="color:#add8e6"><span style="font-family:Arial,Helvetica,sans-serif"><strong>Informa&ccedil;&otilde;es adicionais</strong></span></span><br />\r\n<span style="color:black"><span style="background-color:white; font-family:Arial,Helvetica,sans-serif">Voc&ecirc; viu algo ou algu&eacute;m infringindo as Etiquetas do Hotel ou amea&ccedil;ando a seguran&ccedil;a do oHabbo Hotel? Se sim, n&atilde;o fique calado, procure ajuda e denuncie sempre a um moderador ou membro da equipe, eles ir&atilde;o te auxiliar sempre e em qualquer problema relacionado &agrave; seguran&ccedil;a do hotel como um todo, boa estadia!</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="color:black"><span style="background-color:white; font-family:Arial,Helvetica,sans-serif">Confira quais s&atilde;o as puni&ccedil;&otilde;es, caso voc&ecirc; infrinja alguma regra no nosso hotel:</span></span></p>\r\n\r\n<div class="separator" style="clear:both; text-align:center"><a href="https://4.bp.blogspot.com/-KoqbOqRXO2c/Wup-nqWEAKI/AAAAAAAAAkk/1SRgPS8rvncNr8oVgsS46wWmz0ZLZ18FACLcBGAs/s1600/Screenshot_626.jpg" style="margin-left: 1em; margin-right: 1em;"><span style="color:black; font-family:Arial,Helvetica,sans-serif"><img src="https://4.bp.blogspot.com/-KoqbOqRXO2c/Wup-nqWEAKI/AAAAAAAAAkk/1SRgPS8rvncNr8oVgsS46wWmz0ZLZ18FACLcBGAs/s1600/Screenshot_626.jpg" /></span></a></div>\r\n', 1525374704, 'Stanislaw', 'https://2.bp.blogspot.com/-FFsoctf77bY/Vt49vUqZrAI/AAAAAAAAj9E/AIESBL6dTcM/s1600/habbo_safetyquiz.png', ''),
	(3, 'Teste', 'Teste', '', 1525379614, 'Roberta', 'https://1.bp.blogspot.com/-99G5q-S_fvg/WZyd6Miy1LI/AAAAAAAA8Vs/jzOkcpg1u78owFrQ6uoir7hY2AhHxAZXgCKgBGAs/s1600/WEB_PROMO_NEWYEAR_BAW.png', '');
